package main

const dirListTemplate = `
<!DOCTYPE html>
<html>
<head>
    <title>Directory Listing</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background-color: rgb(12, 15, 26);
            color: #f8f9fa;
            transition: background-color 0.3s, color 0.3s;
        }
        @media (prefers-color-scheme: light) {
            body {
                background-color: #f8f9fa;
                color: #333;
            }
        }
        .header {
            background-color: rgb(12, 15, 26);
            color: #f8f9fa;
            padding: 10px 20px;
            text-align: center;
            transition: background-color 0.3s, color 0.3s;
            display: flex;
            align-items: center;
            justify-content: center;
        }
        @media (prefers-color-scheme: light) {
            .header {
                background-color: #f8f9fa;
                color: #333;
            }
        }
		.header img {
            margin-right: 10px;
        }
        a {
            color: #007bff;
            text-decoration: none;
            transition: color 0.3s;
        }
        a:hover {
            text-decoration: underline;
        }
    </style>
</head>
<body>
    <div class="header">
		<img height="45px" src="data:image/png;base64," />
        <h1>SpectroCloud Web Browser {{.Path}}</h1>
    </div>
    <ul>
		<li><a href="{{.Path}}/..">../ (back)</a></li>
		{{if ne .Path "/"}}
			{{$path := .Path}}
			{{range .Files}}
				<li><a href="{{$path}}/{{.}}">{{.}}</a></li>
			{{end}}
		{{else}}
			{{range .Files}}
				<li><a href="{{.}}">{{.}}</a></li>
			{{end}}
		{{end}}
    </ul>
</body>
</html>
`
